text:
#30DayMapChallenge 2022 day 13, 5 minute map: 
"Disco" #Helsinki was made with #elevation data provided by @geoportal_fi and the default colour palette in #ArcGIS Pro. Map by @BurdunIuliia.
@AaltoUniversity @AaltoENG https://t.co/c9IsgeioJK

giscoR::gisco_get_countries(country = "Vietnam") |&gt;
  elevatr::get_elev_raster(z = 5, clip = "location") |&gt; 
  raster_to_matrix() |&gt;
  sphere_shade() |&gt;
  plot_map(title_text = "30 Day Map Challenge\nDay 13: 5-Minute Map")

#30DayMapChallenge https://t.co/PeibLCKYg8 https://t.co/C7tG3Meco6
